import React from 'react';
import styled from 'styled-components';
import { Container } from '../components/StyledComponents/StyledComponents';
import CoffeeOfTheDay from '../components/Coffee/CoffeeOfTheDay';
import Navigation from '../components/Navigation/Navigation';
import Footer from '../components/Footer/Footer';

const CoffeePageContainer = styled(Container)`
    padding-top: 100px;
    min-height: 100vh;
    background: linear-gradient(
        to bottom,
        ${props => props.theme.colors.coffee[100]},
        ${props => props.theme.colors.coffee[200]},
        ${props => props.theme.colors.coffee[300]},
        ${props => props.theme.colors.coffee[400]},
        ${props => props.theme.colors.coffee[500]}
    );
`;

const Coffee = () => {
    return (
        <>
            <Navigation page="coffee" />
            <CoffeePageContainer>
                <CoffeeOfTheDay />
            </CoffeePageContainer>
            <Footer />
        </>
    );
};

export default Coffee;
